webpackJsonp([44713349584700],{642:function(e,a){e.exports={data:{markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.55555555555556%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="List of Events"\n        title=""\n        src="/blog/static/example-events-01-90360fb9554984afe354e457be7b0773-ad1f0.png"\n        srcset="/blog/static/example-events-01-90360fb9554984afe354e457be7b0773-71707.png 173w,\n/blog/static/example-events-01-90360fb9554984afe354e457be7b0773-14127.png 345w,\n/blog/static/example-events-01-90360fb9554984afe354e457be7b0773-ad1f0.png 690w,\n/blog/static/example-events-01-90360fb9554984afe354e457be7b0773-6758f.png 1035w,\n/blog/static/example-events-01-90360fb9554984afe354e457be7b0773-c0f94.png 1380w,\n/blog/static/example-events-01-90360fb9554984afe354e457be7b0773-18d7a.png 1548w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \nEvents are a list of community-curated endurance events. This list is all about the future. For reference purposes, past events will be featured on another page in an upcoming release.</p>\n<p>Click on the stars next to the titles to “Favorite” events you plan to do and then filter them using the All, Star, or Owner buttons in the top right.</p>\n<p>Below the title are the days or weeks until the event takes place, making it easy to schedule your season and training.</p>\n<p>Don’t see an event on here you want to do? Just press the Add button in the lower right and add your own event.</p>\n<blockquote>\n<p>If you don’t see the add button, you probably forgot to join the A Race athlete club on Strava (<a href="https://www.strava.com/clubs/araceathlete" target="_blank" rel="nofollow">here</a>).</p>\n</blockquote>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 6.555269922879177%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAABCAIAAABR8BlyAAAACXBIWXMAAAsSAAALEgHS3X78AAAAIklEQVQI12P48+fPm/v3n125cufAgefXrv0iDgB1/fv3DwCtnjkgCTrhAgAAAABJRU5ErkJggg==\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Event Action Links"\n        title=""\n        src="/blog/static/example-events-04-a275ba342f560317616fbf38edda9415-ad1f0.png"\n        srcset="/blog/static/example-events-04-a275ba342f560317616fbf38edda9415-71707.png 173w,\n/blog/static/example-events-04-a275ba342f560317616fbf38edda9415-14127.png 345w,\n/blog/static/example-events-04-a275ba342f560317616fbf38edda9415-ad1f0.png 690w,\n/blog/static/example-events-04-a275ba342f560317616fbf38edda9415-6758f.png 1035w,\n/blog/static/example-events-04-a275ba342f560317616fbf38edda9415-c0f94.png 1380w,\n/blog/static/example-events-04-a275ba342f560317616fbf38edda9415-15d32.png 1556w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  </p>\n<ul>\n<li>Permalink to this event to share with fiends</li>\n<li>Add to Google Calendar</li>\n<li>Post this event on Facebook</li>\n<li>Tweet about it on Twitter</li>\n</ul>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 54.41558441558442%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Event Weather"\n        title=""\n        src="/blog/static/example-events-02-19d7b07e777cb97faf124923384da200-ad1f0.png"\n        srcset="/blog/static/example-events-02-19d7b07e777cb97faf124923384da200-71707.png 173w,\n/blog/static/example-events-02-19d7b07e777cb97faf124923384da200-14127.png 345w,\n/blog/static/example-events-02-19d7b07e777cb97faf124923384da200-ad1f0.png 690w,\n/blog/static/example-events-02-19d7b07e777cb97faf124923384da200-6758f.png 1035w,\n/blog/static/example-events-02-19d7b07e777cb97faf124923384da200-c0f94.png 1380w,\n/blog/static/example-events-02-19d7b07e777cb97faf124923384da200-121a5.png 1540w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \nWhen the event gets close, weather for the start location on the day of the event will appear and update as the day approaches.  </p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 82.71446862996159%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Event Details"\n        title=""\n        src="/blog/static/example-events-03-a10b35ec5168952256f4261537dcbf39-ad1f0.png"\n        srcset="/blog/static/example-events-03-a10b35ec5168952256f4261537dcbf39-71707.png 173w,\n/blog/static/example-events-03-a10b35ec5168952256f4261537dcbf39-14127.png 345w,\n/blog/static/example-events-03-a10b35ec5168952256f4261537dcbf39-ad1f0.png 690w,\n/blog/static/example-events-03-a10b35ec5168952256f4261537dcbf39-6758f.png 1035w,\n/blog/static/example-events-03-a10b35ec5168952256f4261537dcbf39-c0f94.png 1380w,\n/blog/static/example-events-03-a10b35ec5168952256f4261537dcbf39-5b8dc.png 1562w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \nEvent details has all kinds of useful information such as:</p>\n<ul>\n<li>Time Zone</li>\n<li>Starting location link opening up Google Maps to help guide you</li>\n<li>Strava Route Links</li>\n<li>Starting Elevation</li>\n<li>Link to Event homepage</li>\n</ul>',frontmatter:{title:"Events",date:"2017-06-03T00:19:00.000Z",path:"/events/",parent:"/home/hypersprite/Documents/code/araceathlete-gatsby-material-ui-v1/src/pages/2017-06-03-events/index.md absPath of file",tags:"newbie,events,goals"}}},pathContext:{slug:"/2017-06-03-events/"}}}});
